import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { DragDropComponent } from './drag-drop/drag-drop.component';
import { DragDropFileUploadDirective } from './drag-drop-file-upload.directive';

import { ReactiveFormsModule } from '@angular/forms';
import {HttpClientModule} from '@angular/common/http';

import { LottieAnimationViewModule } from 'ng-lottie';
import { LotteAnimateComponent } from './lotte-animate/lotte-animate.component';


@NgModule({
  declarations: [AppComponent, DragDropComponent, DragDropFileUploadDirective, LotteAnimateComponent],
  imports: [BrowserModule, AppRoutingModule, ReactiveFormsModule, HttpClientModule, LottieAnimationViewModule.forRoot()],
  providers: [],
  bootstrap: [AppComponent],
})
export class AppModule {}
